import './App.css';

function App() {
  return (
    <>
      <div>
        <h3 className="text-blue-500">Immediate</h3>
        <p>
          <span>Reliance Contractors</span> <span>Sandy, OR</span>
        </p>
      </div>
    </>
  );
}

export default App;
